    def display_home(self):
            self.stackedWidget.setCurrentIndex(0)

    def checkTheme(self):
            if self.checkBox_theme.isChecked():
                    self.changeTheme()        
            if self.checkBox_theme.isChecked() == False:
                    self.defaultTheme()

    def noticeTab(self):
            if self.checkBox_notifications.isChecked():
                username = monitor.getUser()
                telephone = monitor.getTele()
                key = monitor.getKey()
                monitor.createfile(notice='on',user=username,telephon=telephone,code=key)

            if self.checkBox_notifications.isChecked() == False:
                username_2 = monitor.getUser()
                telephone_2 = monitor.getTele()
                key_2 = monitor.getKey()
                monitor.createfile(notice='off',user=username_2,telephon=telephone_2,code=key_2)         

